import {useHistory} from "react-router-dom";
import {useState, useEffect} from "react";
import { TripsCards } from "../components/TripsCard";
// import {BASE_URL} from "/../constant/url"
import axios from "axios";


const ListTripsPage = () => {

    const [trips, setTrips] = useState ([])

    const getTrips = () => {
        axios.get(`https://us-central1-labenu-apis.cloudfunctions.net/labeX/evelyn-oliveira-carver/trips`)
        .then((res)=> {
            setTrips (res.data)
        })
        .catch((err)=> {
            console.log(err)
        })
    }

    useEffect(()=> {
        getTrips();
    },[]);


    const history = useHistory()

    const goBackHome = () => {
        history.goBack()
    }

    const applicationForm = () => {
        history.push("/trips-application")
    }

    console.log(trips)


    return (
        <div>

         <div>{trips.planet}
         <p>{getTrips}</p>
         </div>
 

        <h2>Lista de Viagens</h2>
        

        <button onClick={goBackHome}>Voltar</button>
        <button onClick={applicationForm}>Increva-se</button>
        </div>
    )
    


}

export default ListTripsPage;
